import{_ as e,o as t,c as r,O as o}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 16.1-69.57 Destruction of court records.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/16.1-69.57.md","filePath":"vacode/16.1-69.57.md"}'),a={name:"vacode/16.1-69.57.md"},i=o('<h1 id="§-16-1-69-57-destruction-of-court-records" tabindex="-1">§ 16.1-69.57 Destruction of court records. <a class="header-anchor" href="#§-16-1-69-57-destruction-of-court-records" aria-label="Permalink to &quot;§ 16.1-69.57 Destruction of court records.&quot;">​</a></h1><p>The clerk of each district court shall destroy the court records upon expiration of the appropriate retention period as set forth in §§ <a href="http://law.lis.virginia.gov/vacode/16.1-69.55/" target="_blank" rel="noreferrer">16.1-69.55</a> and <a href="http://law.lis.virginia.gov/vacode/16.1-69.56/" target="_blank" rel="noreferrer">16.1-69.56</a> and consistent with the requirements of confidentiality for juvenile records. The Supreme Court shall determine the methods to be used in destroying court records. Likewise, magistrates shall destroy records retained in the office of the magistrate upon the expiration of the appropriate retention period as set forth in § <a href="http://law.lis.virginia.gov/vacode/16.1-69.56/" target="_blank" rel="noreferrer">16.1-69.56</a>.</p><p>1983, c. 499; 1987, c. 160.</p>',3),s=[i];function n(c,d,h,l,_,f){return t(),r("div",null,s)}const m=e(a,[["render",n]]);export{u as __pageData,m as default};
